import React from "react";
import { IFaShoppingBasket } from "react-icons/fa";

export default function Header() {
  return (
    <header>
      <div>
        {" "}
        <span className="logo">House Staff</span>
        <ul className="nav">
          <li>About us</li>
          <li>Contacts</li>
          <li>Cabinets</li>
        </ul>
        <FaShoppingBasket />
      </div>
      <div className="presentation"></div>
    </header>
  );
}
